import React from 'react';
import logo from './logo.svg';
import './App.css';
import { Component } from 'react';

export class MainPage extends Component{
  constructor(props){
      super(props);
      this.state = {
        showAR: false,
      };
  }

  handleShowAR = ()=>{
    this.setState({showAR: true});
  }

  render(){
    return(
    <div className="App">
      <header className="App-header">
        <button onClick={this.handleShowAR}>AR</button>
      </header>
     </div>
    );
  }
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <button>AR</button>
      </header>
     </div>
  );
}

export default App;
